import React, {useState, useEffect} from 'react';
import img from '../images/police.jpeg';
import { Container, Form, Row, Col, Image, Button} from 'react-bootstrap';

const axios = require('axios');
const baseURL = "https://localhost:3005/trends/crime/";
export default function EvidenceTrends () {


    const [post, setPost] = useState([{}]);

    useEffect(() => {
        axios.get(baseURL).then((res) => {
        setPost(res.data);
        });
    }, []);

    if (!post) return null;


    return (
        <Container fluid>
            <Row>
                <Col md={6}>
                    <h1>Evidence Trends</h1>
                </Col>
            </Row>
            <Row>
                <Col md={3}>
                    <h5>Select Station #</h5>
                    <Button type="submit" class="btn btn-primary">
                        Enter
				    </Button>
                </Col>
		        <Col md={3}>
			        <Form>
                        <Form.Select as="select">
                            <option>Select...</option>
                            {post.length && post.map((item, index)=> (
                                <option value={index}>{item.post}</option>
                            ))}
                        </Form.Select>
                    </Form>
                </Col>
                <Col md={6}>
                   <Image src={img}/> 
                </Col>
            </Row>
        </Container>
    )
}
